Tus efectos de daño de sombra en el tiempo tienen un {c_number}[{SF_0}*100|%x|]{/c} de probabilidad de infligir un {c_number}[{SF_1}*100|%x|]{/c} de daño adicional cada vez que infligen daño. Esta probabilidad aumenta un {c_number}[{SF_2}*100|%x|]{/c} y el daño adicional aumenta un {c_number}[{SF_3}*100|%x|]{/c} por cada {c_number}[{SF_4}]{/c} de inteligencia que tengas.

Probabilidad actual: {c_number}[SF_6 * 100|%|]{/c}
Bonus de daño actual: {c_number}[SF_5 * 100|%x|]{/c}
